  render() {
    return (
      <td>
        <input type='text' placeholder="Enter expense.." name={this.props.cellData.type} id={this.props.cellData.id} value={this.props.cellData.value} onChange={this.props.onProductTableUpdate}/>
      </td>
    );

  }

}

